import React from 'react';
import { useNavigate } from 'react-router-dom';

const AdminDashboard = () => {
  const navigate = useNavigate();
  
  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    navigate('/login');
  };
  
  return (
    <div style={{ padding: '2rem' }}>
      <header style={{
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        marginBottom: '2rem',
        paddingBottom: '1rem',
        borderBottom: '1px solid #eee'
      }}>
        <h1>لوحة تحكم المدير</h1>
        <button onClick={handleLogout} style={{
          padding: '0.5rem 1.5rem',
          background: '#dc3545',
          color: 'white',
          border: 'none',
          borderRadius: '6px',
          cursor: 'pointer'
        }}>
          تسجيل الخروج
        </button>
      </header>
      
      <div style={{ background: 'white', padding: '1.5rem', borderRadius: '10px', boxShadow: '0 3px 15px rgba(0,0,0,0.08)' }}>
        <h2 style={{ color: '#333', marginBottom: '1rem' }}>مرحباً بك في نظام تأجير L3BTY</h2>
        <p style={{ color: '#666', marginBottom: '1.5rem' }}>
          النظام يعمل بنجاح! يمكنك الآن البدء في إدارة الفروع والألعاب والمستخدمين.
        </p>
        
        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))', gap: '1rem', marginTop: '2rem' }}>
          <div style={{ background: '#f8f9fa', padding: '1rem', borderRadius: '8px' }}>
            <h3 style={{ color: '#333', marginBottom: '0.5rem' }}>الفروع</h3>
            <p style={{ fontSize: '2rem', fontWeight: 'bold', color: '#007bff', margin: 0 }}>5</p>
          </div>
          <div style={{ background: '#f8f9fa', padding: '1rem', borderRadius: '8px' }}>
            <h3 style={{ color: '#333', marginBottom: '0.5rem' }}>المستخدمين</h3>
            <p style={{ fontSize: '2rem', fontWeight: 'bold', color: '#28a745', margin: 0 }}>12</p>
          </div>
          <div style={{ background: '#f8f9fa', padding: '1rem', borderRadius: '8px' }}>
            <h3 style={{ color: '#333', marginBottom: '0.5rem' }}>الألعاب</h3>
            <p style={{ fontSize: '2rem', fontWeight: 'bold', color: '#6f42c1', margin: 0 }}>40</p>
          </div>
          <div style={{ background: '#f8f9fa', padding: '1rem', borderRadius: '8px' }}>
            <h3 style={{ color: '#333', marginBottom: '0.5rem' }}>الإيرادات</h3>
            <p style={{ fontSize: '2rem', fontWeight: 'bold', color: '#fd7e14', margin: 0 }}>5,240 ريال</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
